import React from "react";
import { Routes, Route} from "react-router-dom";
import Form from "./components/Form";
import Email from "./components/Email.tsx";


function App() {
  return (
    <div>
      <Routes>
      <Route path="" element={<Form/>}/>
      <Route path="" element={<Email/>}/>
      </Routes>
    </div>
  );
}

export default App;
